                            href="#">Pricing</a>
                    </div>
                </div>
                <div className="flex items-center gap-x-5 md:gap-x-8">
                    <div className="hidden md:block">
                        <a className="inline-block rounded-lg py-1 px-2 text-sm text-slate-700 hover:bg-slate-100 hover:text-slate-900"
                            href="#">Sign in</a>
                    </div>
                    <a className="group inline-flex items-center justify-center rounded-full py-2 px-4 text-sm font-semibold 
                    focus:outline-none focus-visible:outline-2 focus-visible:outline-offset-2 bg-blue-600 
                    text-white hover:text-slate-100 hover:bg-blue-500 active:bg-blue-800 active:text-blue-100 focus-visible:outline-blue-600"
